INSERT INTO `products` VALUES (6,'Bộ Bàn Ăn Scania (Màu Tự Nhiên, Mặt Vân Đá, 140)',100,13990000,11990000,'<p><span style=\"font-family: \'times new roman\', times, serif;\"><strong>BỘ&nbsp;B&Agrave;N ĂN V&Acirc;N Đ&Aacute; TỰ NHI&Ecirc;N&nbsp;<u>SCANIA</u></strong></span></p>\r\n<h2><span style=\"font-family: \'times new roman\', times, serif;\"><strong>1. TH&Ocirc;NG SỐ KỸ THUẬT</strong></span></h2>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Nội dung sản phẩm\" src=\"https://file.hstatic.net/200000065946/file/z6597452262947_58a5437d38425367e5b0c8e62af26737_57c61a20a44b4815bf4ac9abd4b97737_2048x2048.jpg\" alt=\"bộ b&agrave;n ăn scania\" width=\"252\" height=\"252\"></span></p>\r\n<p>&nbsp;</p>\r\n<h2><span style=\"font-family: \'times new roman\', times, serif;\"><strong>2. CHI TIẾT VẬT LIỆU</strong></span></h2>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><strong>Khung ch&acirc;n : Gỗ cao su tự nhi&ecirc;n</strong></span></p>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\">B&agrave;n ăn gia đ&igrave;nh l&agrave;m từ chất liệu&nbsp;<a href=\"https://moho.com.vn/blogs/noi-that-ung-dung/tim-hieu-ve-cac-loai-go-tu-nhien-thong-dung\" target=\"_blank\" rel=\"noopener\"><u><strong>gỗ cao su</strong></u></a>&nbsp;tự nhi&ecirc;n đảm bảo độ chắc chắn cao, chống c&ocirc;ng v&ecirc;nh, mối mọt. M&agrave;u gỗ bắt mắt, đẹp tạo n&eacute;t hiện đại&nbsp;.</span></p>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><strong>Mặt b&agrave;n : Gỗ c&ocirc;ng nghiệp phủ Melamine v&acirc;n đ&aacute; tự nhi&ecirc;n&nbsp;</strong></span></p>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\">Lớp phủ Melamine c&oacute; thể t&aacute;i tạo ch&acirc;n thật v&acirc;n đ&aacute; tự nhi&ecirc;n mang lại vẻ đẹp sang trọng v&agrave; hiện đại.</span></p>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Nội dung sản phẩm\" src=\"https://file.hstatic.net/200000065946/file/z6526735263438_ce3f3e4fb92840a04b2488b8a5ceffe2_1024x1024.jpg\" width=\"372\" height=\"186\"></span></p>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><em>* Một số sản phẩm sử dụng gỗ tự nhi&ecirc;n c&oacute; thể xuất hiện mắt gỗ ngẫu nhi&ecirc;n v&agrave; v&acirc;n gỗ tr&ecirc;n bề mặt mỗi sản phẩm sẽ kh&aacute;c nhau &ndash; điều n&agrave;y l&agrave; ho&agrave;n to&agrave;n tự nhi&ecirc;n, tạo n&ecirc;n sự độc đ&aacute;o ri&ecirc;ng cho từng sản phẩm. V&igrave; vậy MOHO sẽ kh&ocirc;ng &aacute;p dụng c&aacute;c ch&iacute;nh s&aacute;ch đổi trả, bảo h&agrave;nh v&agrave; bảo tr&igrave; cho c&aacute;c trường hợp n&agrave;y.</em></span></p>\r\n<p>&nbsp;</p>\r\n<h2><span style=\"font-family: \'times new roman\', times, serif;\"><strong>3.&nbsp;ĐẶC ĐIỂM NỔI BẬT</strong></span></h2>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\">Mang phong c&aacute;ch hiện đại v&agrave; tinh tế, B&agrave;n Ăn SCANIA v&acirc;n đ&aacute; l&agrave; lựa chọn ho&agrave;n hảo cho kh&ocirc;ng gian ph&ograve;ng ăn sang trọng. Sự kết hợp giữa mặt b&agrave;n v&acirc;n giả đ&aacute; cao cấp v&agrave; khung ch&acirc;n từ gỗ cao su tự nhi&ecirc;n vững chắc kh&ocirc;ng chỉ mang đến vẻ đẹp thẩm mỹ m&agrave; c&ograve;n đảm bảo độ bền vượt trội theo thời gian.&nbsp;</span></p>\r\n<h3><span style=\"font-family: \'times new roman\', times, serif;\"><strong>Mặt b&agrave;n gỗ c&ocirc;ng nghiệp phủ Melamine v&acirc;n đ&aacute; tự nhi&ecirc;n</strong></span></h3>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\">Tạo cảm gi&aacute;c sang trọng, hiện đại như đ&aacute; thật m&agrave; nhẹ&nbsp;hơn rất nhiều.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Nội dung sản phẩm\" src=\"https://file.hstatic.net/200000065946/file/dsc04419_1024x1024.jpg\" width=\"243\" height=\"243\"></span></p>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><strong>Gi&aacute; th&agrave;nh hợp l&yacute; :&nbsp;</strong>So với mặt đ&aacute; tự nhi&ecirc;n, mặt b&agrave;n phủ Melamine v&acirc;n đ&aacute; c&oacute; chi ph&iacute; thấp hơn nhiều nhưng vẫn giữ được n&eacute;t đẹp tinh tế</span></p>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Nội dung sản phẩm\" src=\"https://file.hstatic.net/200000065946/file/dsc04395_1024x1024.jpg\" width=\"243\" height=\"243\"></span></p>\r\n<h3><span style=\"font-family: \'times new roman\', times, serif;\"><strong>Cạnh b&agrave;n được thiết kế bo tr&ograve;n</strong></span></h3>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\">Thiết kế b&agrave;n ăn hiện đại tối ưu sự an to&agrave;n của người d&ugrave;ng được thể hiện qua c&aacute;c g&oacute;c cạnh được bo tr&ograve;n, hạn chế tổn thương nếu xảy ra va đập, nhất l&agrave; đối với những gia đ&igrave;nh c&oacute; trẻ nhỏ hiếu động.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Nội dung sản phẩm\" src=\"https://file.hstatic.net/200000065946/file/dsc04389_a5d5e670fcff43398779a312b59c0398_1024x1024.jpg\" width=\"300\" height=\"300\"></span></p>\r\n<p>&nbsp;</p>\r\n<h3>&nbsp;</h3>\r\n<h3><span style=\"font-family: \'times new roman\', times, serif;\"><strong>Chiều cao bộ&nbsp;b&agrave;n thể hiện&nbsp;được th&oacute;i quen sử dụng của người Việt</strong></span></h3>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\">Chiều cao bộ&nbsp;b&agrave;n ăn SCANIA&nbsp;đạt chuẩn 75cm ph&ugrave; hợp cho gia đ&igrave;nh bạn. K&iacute;ch thước b&agrave;n&nbsp;ăn n&agrave;y rất dễ d&agrave;ng bắt gặp tại c&aacute;i ng&ocirc;i nh&agrave; hay qu&aacute;n ăn&nbsp;tại Việt Nam, v&igrave; n&oacute; mang lại sự gần gũi v&agrave; thuận tiện khi d&ugrave;ng bữa v&agrave; l&agrave;m việc.</span></p>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Nội dung sản phẩm\" src=\"https://file.hstatic.net/200000065946/file/dsc04416_1024x1024.jpg\" width=\"298\" height=\"298\"></span></p>\r\n<p>&nbsp;</p>\r\n<h3><span style=\"font-family: \'times new roman\', times, serif;\"><strong>Mặt b&agrave;n hạn chế&nbsp;thấm nước</strong></span></h3>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\">Mặt b&agrave;n ăn cơm hạn chế&nbsp;thấm nước&nbsp;gi&uacute;p cho việc lau ch&ugrave;i trở n&ecirc;n đơn giản v&agrave; dễ d&agrave;ng hơn mỗi khi d&ugrave;ng bữa.</span></p>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Nội dung sản phẩm\" src=\"https://file.hstatic.net/200000065946/file/dsc04395_3354fa2cbaf34ef3918e5eee61e621d9_1024x1024.jpg\" width=\"307\" height=\"307\"></span></p>\r\n<h3>&nbsp;</h3>\r\n<h3><span style=\"font-family: \'times new roman\', times, serif;\"><strong>Kết cấu khung ch&acirc;n chắc chắn</strong></span></h3>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\">Ch&acirc;n b&agrave;n&nbsp;chế t&aacute;c từ gỗ cao su tự nhi&ecirc;n, đảm bảo kết cấu chắc chắn, vững ch&atilde;i&nbsp;v&agrave; khả năng chịu lực tốt,&nbsp;c&ugrave;ng logo MOHO độc quyền tr&aacute;nh h&agrave;ng giả.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Nội dung sản phẩm\" src=\"https://file.hstatic.net/200000065946/file/dsc04380_1024x1024.jpg\" width=\"276\" height=\"276\"></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h2><span style=\"font-family: \'times new roman\', times, serif;\"><strong>4. KH&Ocirc;NG GIAN SỐNG</strong></span></h2>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><strong>Bộ&nbsp;B&agrave;n Ăn v&acirc;n đ&aacute; SCANIA</strong>&nbsp;với thiết kế kiểu d&aacute;ng hiện đại, k&iacute;ch thước&nbsp;chiều cao ti&ecirc;u chuẩn 75cm, chất liệu gỗ cao su th&acirc;n thiện m&ocirc;i trường, an to&agrave;n sức khỏe ph&ugrave; hợp với nhiều phong c&aacute;ch&nbsp;<strong><a href=\"https://moho.com.vn/\" target=\"_blank\" rel=\"noopener\">nội thất</a></strong>&nbsp;kh&aacute;c nhau, c&oacute; thể kết hợp c&aacute;c mẫu&nbsp;<strong><a href=\"https://moho.com.vn/collections/ghe-an\" target=\"_blank\" rel=\"noopener\">ghế ăn</a></strong>&nbsp;kh&aacute;c để tạo n&ecirc;n&nbsp;<strong><a href=\"https://moho.com.vn/collections/bo-ban-an\" target=\"_blank\" rel=\"noopener\">bộ b&agrave;n ăn 4</a></strong>&nbsp;ghế hoặc<strong><u>&nbsp;6 ghế</u>&nbsp;</strong>ho&agrave;n chỉnh, kiến tạo&nbsp;kh&ocirc;ng gian&nbsp;<strong><u><a href=\"https://moho.com.vn/collections/bo-ban-an\" target=\"_blank\" rel=\"noopener\">nội thất ph&ograve;ng ăn</a></u></strong> ấm c&uacute;ng, gắn kết c&aacute;c th&agrave;nh vi&ecirc;n trong gia đ&igrave;nh với nhau.</span></p>',0,'/uploads/ac3fb15d-c090-465f-b7aa-4e3e4fba239d.webp||/uploads/336fe673-c529-4d52-b18b-0855626d006d.webp||/uploads/81e4ec70-6311-494e-8870-1a59b5f2b569.webp||/uploads/beb6e200-f9e9-40d8-ada6-f3dcc405df46.webp||/uploads/4c2d3d8f-76e2-4aed-9577-6211f56f06e9.webp**#ecd4a8||#eef0ec','Chiều dài 140cm x Chiều rộng 70cm x Chiều cao 75cm ',1,'2025-05-20','2025-06-08',1,29,'X123','Gỗ công nghiệp phủ Melamine vân đá tự nhiên'),(7,'Bàn Ăn Scania (Màu Tự Nhiên, Mặt Vân Đá, 140)',100,5690000,3590000,'<p style=\"text-align: center;\"><span style=\"font-family: \'times new roman\', times, serif;\"><strong>B&Agrave;N ĂN V&Acirc;N Đ&Aacute; TỰ NHI&Ecirc;N&nbsp;<u>SCANIA</u></strong></span></p>\r\n<h2><span style=\"font-family: \'times new roman\', tim