pan style=\"font-family: \'times new roman\', times, serif;\">B&agrave;n được thiết kế c&oacute; cạnh gờ, gi&uacute;p hạn chế tr&agrave;n nước xuống nền nh&agrave; v&agrave; hạn chế rơi đồ vật.</span></p>',0,'/uploads/c0ec4833-84b0-4612-a369-f7e16952671b.webp||/uploads/1ea8b9bd-8366-428e-bfcc-a3f18d7e9374.webp||/uploads/c768da2a-7db8-458a-80cc-f25ddc901794.webp||/uploads/4510b4d7-b369-4c97-a30b-ab35f2da7b33.webp**#776e5a','Dài 180cm x Rộng 85cm x Cao 69cm',1,'2025-05-25','2025-06-08',1,31,'X123','Gỗ cao su tự nhiên - Gỗ thông tự nhiên'),(10,'Combo Phòng Ngủ MOHO VLINE Màu Nâu',100,28460000,20390000,'<div>\r\n<h2><span style=\"font-family: \'times new roman\', times, serif;\"><strong>Chi tiết vật liệu</strong></span></h2>\r\n<div>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><strong>Gỗ tự nhi&ecirc;n</strong></span></p>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\">Sử dụng&nbsp;gỗ cao su v&agrave; gỗ&nbsp;tr&agrave;m tự nhi&ecirc;n đảm bảo vệ độ chắc chắn cao, chịu lực tốt v&agrave; bền l&acirc;u</span></p>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><strong>Gỗ c&ocirc;ng nghiệp MDF/MFC</strong></span></p>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\">Gỗ c&ocirc;ng nghiệp (PB, MDF) đạt&nbsp;<strong><a href=\"https://moho.com.vn/blogs/inspiration/noi-that-moho-dat-chuan-carb-p2-an-toan-cho-suc-khoe\" target=\"_blank\" rel=\"noopener\"><u>chuẩn&nbsp;CARB-P2</u></a></strong>&nbsp;an to&agrave;n tuyệt đối cho người sức khỏe người d&ugrave;ng v&agrave; đạt&nbsp;<strong><a href=\"https://moho.com.vn/blogs/noi-that-ung-dung/chung-nhan-fsc-chung-nhan-bao-ve-rung-quy-mo-toan-cau\" target=\"_blank\" rel=\"noopener\"><u>chứng nhận FSC</u></a></strong>&nbsp;bảo vệ v&agrave; ph&aacute;t triển rừng bền vững.&nbsp;</span></p>\r\n<div>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><strong>Gỗ c&ocirc;ng nghiệp Plywood</strong></span></p>\r\n<p><span style=\"font-